var onExecutionError = function (exception, name) {
    var extra = sys.trackstackstr();
    if (extra == '') {
        if (exception.name.indexOf('HaltException', 0) < 0) { 
            extra = "\n.  Rebuild with pyjsbuild -d for more information.";
        }
    } else {
        extra = "\n" + extra;
    }
    alert( "In application " + name + " - " + 
          exception.name + ': '  + exception.message + extra);
};

function app_imported() {
    $p = $pyjs.loaded_modules['pyjslib'];
    $p('pyjslib');
    $pyjs.__modules__.pyjslib = $p['pyjslib']
    pyjslib.___import___(
               'sampleBallot',
               null,
               '__main__');
    return;
}

function prepare_app() {
    var startWait = 30000;
    var diffWait = 10000;
    var startAt = (new Date()).getTime();
    var waitUntil = startAt + startWait;
    // Wait until all (dynamic) modules are loaded, and then call app_imported()
    var wait_for_loading_modules = function ( proceed_fn, module_list ) {
        var timeoutperiod = 100;
        var wait = function ( ) {
            var notLoaded = [];
            for (var i in module_list) {
                if (typeof $pyjs.loaded_modules[module_list[i]] != 'function') {
                    notLoaded.push(module_list[i]);
                }
            }
            if (notLoaded.length != 0) {
                var now = new Date();
                if (now.getTime() >= waitUntil) {
                    var msg = "Module not loaded yet: " + notLoaded.length
                    if (notLoaded.length <= 2) {
                        msg += "\n" + notLoaded.toString();
                    }
                    msg += "\n" + "Wait for missing modules?"
                    var answer = $wnd.confirm(msg);
                    if (answer == false) {
                        proceed_fn();
                        return;
                    }
                    waitUntil = (new Date()).getTime() + diffWait;
                }
                setTimeout(wait, timeoutperiod);
            } else {
                proceed_fn();
            }
        };
        wait();
    }
    wait_for_loading_modules(app_imported, ['gwt.ui.Label','pyjamas.ui','gwt.ui.KeyboardListener','gwt.log','pyjamas.ui.InnerText','pyjamas.ui.Widget','pyjamas.ui.ClickListener','gwt.ui.HorizontalPanel','pyjamas.Location','sys','gwt.ui.DropHandler','gwt.ui.FocusListener','gwt.ui.InnerText','gwt.ui.MouseListener','pyjamas','pyjamas.ui.HorizontalPanel','gwt.Location','gwt.ui.CellPanel','pyjamas.ui.CellPanel','gwt.ui.Widget','gwt.Window','gwt.ui.ComplexPanel','gwt.ui.ClickListener','pyjamas.ui.MouseListener','gwt.EventController','pyjamas.ui.KeyboardListener','pyjamas.ui.Event','pyjamas.log','pyjamas.ui.DropHandler','pyjamas.Window','gwt.ui.DragHandler','dynamic','pyjamas.ui.Label','pyjamas.ui.Panel','pyjamas.Factory','gwt.ui.HTML','pyjd','gwt.ui.UIObject','ballotTree','pyjamas.ui.InnerHTML','pyjamas.ui.ComplexPanel','pyjslib','fysom','sampleBallot','gwt.DOM','gwt.ui.Panel','gwt','pyjamas.DOM','gwt.ui.InnerHTML','pyjamas.EventController','gwt.ui','pyjamas.ui.HTML','pyjamas.ui.DragHandler','gwt.ui.Event','pyjamas.ui.UIObject','pyjamas.ui.FocusListener']);
}

function pygwtOnLoad(onLoadError, name) {
    if (onLoadError != null)
        try {
            prepare_app();
        } catch (exception) {
            onLoadError(exception, name);
        }
    else {
        prepare_app();
    }
}

$pyjs.script_onload = function (modname) {
    $pyjs.loaded_modules[modname] = function () { return null };
}

$pyjs.script_onreadystate = function (modname) {
    if (js.readyState == 'complete') {
        $pyjs.script_onload(modname);
    }
}
--></script>
